package unitTests;

import static org.junit.Assert.*;

import java.awt.Image;
import java.io.File;
import java.io.IOException;
import java.lang.reflect.InvocationTargetException;
import java.lang.reflect.Method;

import javax.imageio.ImageIO;

import org.junit.After;
import org.junit.Before;
import org.junit.Test;

import certification.Certification;
import certification.CertificationManager;

public class CertificationManagerTest {
	CertificationManager manager_ = null;

	@Before
	public void setUp() throws Exception {
		manager_ = new CertificationManager();
	}

	@After
	public void tearDown() throws Exception {
	}

	@Test
	public void testGetFileExtendsion() throws InstantiationException, IllegalAccessException, NoSuchMethodException,
			SecurityException, IllegalArgumentException, InvocationTargetException {
		CertificationManager manager = CertificationManager.class.newInstance();
		Method method = manager.getClass().getDeclaredMethod("getFileExtendsion", String.class);
		method.setAccessible(true);

		assertEquals((String) method.invoke(manager, ""), "");
		assertEquals((String) method.invoke(manager, "asdf.txt"), "txt");
		assertEquals((String) method.invoke(manager, "C:\\Users\\User\\workspace\\.metadata\\.plugins\\org.eclipse.wst.server.core\\tmp0\\wtpwebapps\\SLM2016\\Images\\download.png"), "png");
	}

	@Test
	public void testEncodeImageToString() throws IOException, InstantiationException, IllegalAccessException,
			NoSuchMethodException, SecurityException, IllegalArgumentException, InvocationTargetException {
		CertificationManager manager = CertificationManager.class.newInstance();
		Method method = manager.getClass().getDeclaredMethod("encodeImageToString", Image.class, String.class);
		method.setAccessible(true);

		Image image = ImageIO.read(new File("WebContent\\images\\download.png"));
		method.invoke(manager, image, "png");
		assertEquals(manager.getCertificationJsonString(), "iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHUlEQVR42mP4//8/w38Ghv9wDCaRBaCYFEEsZgIADvU1y6BjSRkAAAAASUVORK5CYII=");
	}

	@Test
	public void testSetCertificationText() throws InstantiationException, IllegalAccessException, NoSuchMethodException,
			SecurityException, IOException, IllegalArgumentException, InvocationTargetException {
		CertificationManager manager = CertificationManager.class.newInstance();
		Method setCertificationMethod = manager.getClass().getDeclaredMethod("setCertificationText", Image.class, Certification.class);
		setCertificationMethod.setAccessible(true);

		Image image = ImageIO.read(new File("WebContent\\images\\solution.png"));
		setCertificationMethod.invoke(manager, image, new Certification("SCRUM1603-33", "陳泰迪"," 於 2016 年 03 月 22、23 日","Scrum敏捷方法實作班","全期共十二小時研習期滿，特此證明","2016 年 3 月 23 日"));

		Method encodeImageMethod = manager.getClass().getDeclaredMethod("encodeImageToString", Image.class,	String.class);
		encodeImageMethod.setAccessible(true);
		encodeImageMethod.invoke(manager, image, "png");								      
		assertEquals(manager.getCertificationJsonString(), "");
	}

	@Test
	public void testMakeCertification() {
		manager_.makeCertification(new Certification("SCRUM1603-33", "陳泰迪"," 於 2016 年 03 月 22、23 日","Scrum敏捷方法實作班","全期共十二小時研習期滿，特此證明","2016 年 3 月 23 日"), "WebContent\\images\\solution.png");
		assertEquals(manager_.getCertificationJsonString(), "");
	}
}
